'',
'    apex_javascript.add_onload_code',
'    (',
'      p_code => ''apex.jQuery("#'' || p_region.static_id || ''").wfp({'' ||',
'                  apex_javascript.add_attribute',
'                  (',
'                    p_name      => ''ajaxIdentifier''',
'                  , p_value     => apex_plugin.get_ajax_identifier',
'                  , p_add_comma => true',
'                  ) ||',
'                  apex_javascript.add_attribute',
'                  (',
'                    p_name      => ''itemsToSubmit''',
